var division= document.getElementById("DivisionUno");
var divisiondos= document.getElementById("DivisionDos");
division.addEventListener("mouseover", agrando);
division.addEventListener("mouseout", achicar);
divisiondos.addEventListener("mouseover", agrando);
divisiondos.addEventListener("mouseout", achicar);

function agrando(){
  division.setAttribute("style", "width:200px; height:200px; background-color:#F7DF1E; color:black;");
  divisiondos.setAttribute("style", "width:450px; height:30px; background-color:#F7DF1E; color:black;");
}
function achicar(){
  division.setAttribute("style", "width:100px;height:100px");
    divisiondos.setAttribute("style", "width:100px;height:100px");
}
